import './App.css';
import Header from './MyComponents/Header';
import {Todos} from './MyComponents/Todos';
import {Footer} from './MyComponents/Footer';
function App() {
  let todos=[
    {
      sno:1,
      title:"Go to Temple",
      desc:"Let's go to the temple for pray"
    },
    {
      sno:2,
      title:"Work",
      desc:"Project Work"
    },
    {
      sno:3,
      title:"Hello",
      desc:"Project Hello"
    }
  ]
  return (
    <>
     <Header title="Bhumi's To-do List" search={false}/>
     <Todos/>
     <Footer/>
    </>
  );
}

export default App;
